import React, { useState, useEffect } from 'react';
import { Search, MapPin } from 'lucide-react';

// Helper to load Google Maps script
const loadGoogleMapsScript = () => {
  const script = document.createElement('script');
  script.src = `https://maps.googleapis.com/maps/api/js?key=AIzaSyBUE_42ctF3i-1x77Wec5d3bSRLQpzzWN0&libraries=places`;
  script.async = true;
  script.defer = true;
  document.head.appendChild(script);
  return new Promise((resolve) => {
    script.onload = resolve;
  });
};

const SearchPage = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [suggestions, setSuggestions] = useState([]);
  const [autocompleteService, setAutocompleteService] = useState(null);
  const [placesService, setPlacesService] = useState(null);
  const [loading, setLoading] = useState(false);

  // Initialize Google Places services
  useEffect(() => {
    const initGoogleServices = async () => {
      await loadGoogleMapsScript();
      if (window.google) {
        const autocomplete = new window.google.maps.places.AutocompleteService();
        const places = new window.google.maps.places.PlacesService(
          document.createElement('div')
        );
        setAutocompleteService(autocomplete);
        setPlacesService(places);
      }
    };
    initGoogleServices();
  }, []);

  // Handle search input changes
  useEffect(() => {
    if (!autocompleteService || searchQuery.length < 3) {
      setSuggestions([]);
      return;
    }

    const getPlacePredictions = async () => {
      try {
        const response = await new Promise((resolve, reject) => {
          autocompleteService.getPlacePredictions(
            {
              input: searchQuery,
              types: ['gym'], // Restrict to gyms
              componentRestrictions: { country: 'nl' } // Restrict to Netherlands
            },
            (predictions, status) => {
              if (status === window.google.maps.places.PlacesServiceStatus.OK) {
                resolve(predictions);
              } else {
                reject(status);
              }
            }
          );
        });

        setSuggestions(response);
      } catch (error) {
        console.error('Error fetching predictions:', error);
        setSuggestions([]);
      }
    };

    const timeoutId = setTimeout(getPlacePredictions, 300);
    return () => clearTimeout(timeoutId);
  }, [searchQuery, autocompleteService]);

  const handleSuggestionClick = async (placeId) => {
    if (!placesService) return;

    setLoading(true);
    try {
      const placeDetails = await new Promise((resolve, reject) => {
        placesService.getDetails(
          {
            placeId: placeId,
            fields: ['name', 'formatted_address', 'geometry']
          },
          (place, status) => {
            if (status === window.google.maps.places.PlacesServiceStatus.OK) {
              resolve(place);
            } else {
              reject(status);
            }
          }
        );
      });

      // Navigate to results page with venue details
      window.location.href = `/results?name=${encodeURIComponent(placeDetails.name)}&address=${encodeURIComponent(placeDetails.formatted_address)}`;
    } catch (error) {
      console.error('Error fetching place details:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-4xl font-bold text-center text-blue-600 mb-12">GymSpotCheck</h1>

        <div className="relative mb-8">
          <input
            type="text"
            placeholder="Search for a gym"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            className="w-full p-4 pr-12 text-gray-900 border border-gray-300 rounded-t-lg shadow-sm focus:ring-2 focus:ring-blue-500 focus:border-transparent"
          />
          <Search className="absolute right-4 top-1/2 transform -translate-y-1/2 text-gray-400" />

          {suggestions.length > 0 && (
            <div className="absolute w-full bg-white border border-gray-300 border-t-0 rounded-b-lg shadow-lg z-10">
              {suggestions.map((suggestion) => (
                <div
                  key={suggestion.place_id}
                  className="p-3 hover:bg-gray-50 cursor-pointer border-b border-gray-100 last:border-b-0"
                  onClick={() => handleSuggestionClick(suggestion.place_id)}
                >
                  <div className="flex items-start">
                    <MapPin className="text-gray-400 mt-1 mr-2 flex-shrink-0" size={18} />
                    <div>
                      <div className="font-medium">{suggestion.structured_formatting.main_text}</div>
                      <div className="text-sm text-gray-500">{suggestion.structured_formatting.secondary_text}</div>
                    </div>
                  </div>
                </div>
              ))}
              <div className="p-2 text-right text-xs text-gray-400 border-t border-gray-100">
                powered by Google
              </div>
            </div>
          )}
        </div>

        {loading && (
          <div className="text-center text-gray-600">
            Loading...
          </div>
        )}
      </div>
    </div>
  );
};

export default SearchPage;
